import React, { useState, useEffect } from "react";
import "../style/Results.css";

function App() {    

    const [time] = useState(288);
    const [cost] = useState(100);

    function setTime(newTime){
        time = newTime;
    }

    function setCost(newTime){
        time = newTime;
    }

    function Test() {
        if (cost===69){
            return <h1>You are gay</h1>;
        }
        else if (cost===42){
            return <h1>Blaze it</h1>;
        }
        return;
    }

    function Result({ number, airline, departure, arrival, time, cost, layovers }) {
        return (
          <tr>
          <td>{number}</td>
          <td>{airline}</td>
          <td>{departure}</td>
          <td>{arrival}</td>
          <td>{time}</td>
          <td>{cost}</td>
          <td>{layovers}</td>
          </tr>
          );
    }

    return (

        <div className="App">

            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>

            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css"/>
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/js/bootstrap.min.js"></script>
            <script src="https://unpkg.com/vue@3/dist/vue.global.js"></script>

            <div className="App-body">
                <div class="container">
                    <h1>Filters:</h1>
                    <div class="row">
                        <div class="col-sm-6">
                            <div className="Slider">
                                <h2>Cost Limits</h2>
                                <p>Move the slider to choose how much you are willing to pay foryour trip.</p>
                                <input id="costRange"
                                    max={100}
                                    type="range"
                                    value={cost}
                                    onChange={(e) => setCost(e.target.valueAsNumber)}
                                />
                                <p>Maximum cost: €{cost*10}</p>
                                <Test/>
                            </div>
                        </div>
                        <div class="col-sm-6">
                            <div className="Slider">
                                <h2>Time Limits</h2>
                                <p>Move the slider to choose how long you are willing your trip to take.</p>
                                <input id="timeRange"
                                    max={288}
                                    type="range"
                                    value={time}
                                    onChange={(e) => setTime(e.target.valueAsNumber)}
                                />
                                <p>Maximum time: {parseInt(time*5/60)} hr {time*5 % 60} min</p>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="container">
                    <h1>Flight Results:</h1>
                    <div class="dropdown">
                        <button class="dropbtn">Sort results by...</button>
                        <div class="dropdown-content">
                            <a href="#">Time</a>
                            <a href="#">Cost</a>
                            <a href="#">Airline</a>
                        </div>
                    </div>        
                    <table class="table table-bordered">
                        <thead>
                            <tr>
                                <th>Flight number</th>
                                <th>Airline</th>
                                <th>Departure Time</th>
                                <th>Arrival Time</th>
                                <th>Total Time</th>
                                <th>Total Cost</th>
                                <th># Layovers</th>
                            </tr>
                        </thead>
                        <tbody>
                            <Result 
                            number="A4546" 
                            airline="Lufthansa"
                            departure="10:10"
                            arrival="12:35"
                            time="2 hr 25 min"
                            cost="€98"
                            layovers="0"
                            />
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default App;
